    <script type="text/javascript">
        function tab(id){
            var uploadSection = document.getElementById('uploadSection');
            var clipSection = document.getElementById('clipSection');
            var textSection = document.getElementById('textSection');
            var productSection = document.getElementById('productSection');
            switch (id){
                case "1":
                    uploadSection.style.display = "block";
                    clipSection.style.display = "none";
                    textSection.style.display = "none";
                    productSection.style.display = "none";
                break;
                case "2":
                    uploadSection.style.display = "none";
                    clipSection.style.display = "block";
                    textSection.style.display = "none";
                    productSection.style.display = "none";
                break;
                case "3":
                    uploadSection.style.display = "none";
                    clipSection.style.display = "none";
                    textSection.style.display = "block";
                    productSection.style.display = "none";
                break;
                default:
                    uploadSection.style.display = "none";
                    clipSection.style.display = "none";
                    textSection.style.display = "none";
                    productSection.style.display = "block";
            }
        }
    </script>
